(1074, 91, '', 'SESA', 'P-546537\n', '3', 2014, 'FEMININO', 'a', 'a', 'a', 'a', 'd', 'e', 'a', 'Quando o solicitante pede uma manutencao pede-se para manter o tempo minimo de ate dois para o atendimento que e normal, para este caso que nao foi.', '', '', '', '', 'Foi feita a ligacao para abertura do chamado e atendente disse que o caso nao era responsabilidade da informatica. Que a solicitante teria que fazer um empenho para comprar os fios e instalar por conta propria. Houve entao nova tentativa de abertura de chamado e depois de argumentar que nao se faria um empenho enquanto houvesse um laudo dos tecnicos no local para posterior justificativa de compra. Entao o tecnico foi ate o local e verificou que nao era necessario a compra dos fios, apenas a manutencao resolveu o problema.', 'Demorou uma semana e meia para a real solucao do problema.', '', 'Quando o solicitante pede uma manutencao pede-se para manter o tempo minimo de ate dois para o atendimento que e normal, para este caso que nao foi.', '', 'Melina Peterman', 'Jacarezinho', '', 'Jose Lucas Filho', 'NR JACAREZINHO'),
