(1082, 99, '', 'EMATER', 'P-546009\n', '3', 2014, 'FEMININO', 'd', 'c', 'c', 'b', 'a', 'd', 'b', 'Considera o erro do tecnico Jose Dirceu muito grave, pois todo seu trabalho de 5 anos foi perdido.Porem considera o atendimento da Celepar como um todo muito bom, o problema foi muito pontual com o atendimento do tecnico descrito acima.', 'Tecnico Jose Dirceu excluiu todas as pastas do seu computador, tudo desde 2010.Em um novo pedido o tecnico Alvino tentou recuperar o que o outro tecnico tinha perdido, mas sem sucesso. O computador foi levado para regional para tentar solucionar o problema. Considera o tecnico Jose Dirceu ruim e o atendimento do Alvino bom.', 'Tecnico Jose Dirceu excluiu todas as pastas do seu computador, tudo desde 2010.Em um novo pedido o tecnico Alvino tentou recuperar o que o outro tecnico tinha perdido, mas sem sucesso. O computador foi levado para regional para tentar solucionar o problema. Considera o tecnico Jose Dirceu ruim e o atendimento do Alvino bom.', 'Ainda nao teve solucao do problema.', '', '', 'Problema nao foi solucionado e tecnico perdeu o todo seu trabalho arquivado de 5 anos.', '', 'Considera o erro do tecnico Jose Dirceu muito grave, pois todo seu trabalho de 5 anos foi perdido.Porem considera o atendimento da Celepar como um todo muito bom, o problema foi muito pontual com o atendimento do tecnico descrito acima.', '', 'Daniela', 'Nova Laranjeiras', '', 'Jose Dirceu Backes', 'NR GUARAPUAVA'),
