(1158, 175, '', 'TELECENTROS', 'P-549306\n', '3', 2014, 'FEMININO', 'a', 'a', 'b', 'a', 'b', 'b', 'b', 'Gostaria de fazer a sugestao de que os tecnicos fizessem uma manutencao programada no final do mes de dezembro e no meio do ano tambem, para fazer as atualizacÃµes anuais de sistema a cada nova versao, ou seja, provavelmente a cada seis meses.Se tiver alguma novidade de sistemas da Celepar, gostaria de ser comunicada para realizar a capacitacao do gestor do telecentro atraves de modulos online. Gostaria que tivesse um controle de tempo cronologico para uso do computador pelos usuarios, gostaria que aparecesse no historico dos usuarios a ORDEM de entrada e saida de cada um, para melhor controle de uso do tempo de cada um. Por que atualmente os nomes ficam todos misturados e isto provoca conflitos na vez de utilizar o computador entre usuarios.', '', '', '', '', '', '', '', 'Gostaria de fazer a sugestao de que os tecnicos fizessem uma manutencao programada no final do mes de dezembro e no meio do ano tambem, para fazer as atualizacÃµes anuais de sistema a cada nova versao, ou seja, provavelmente a cada seis meses.Se tiver alguma novidade de sistemas da Celepar, gostaria de ser comunicada para realizar a capacitacao do gestor do telecentro atraves de modulos online. Gostaria que tivesse um controle de tempo cronologico para uso do computador pelos usuarios, gostaria que aparecesse no historico dos usuarios a ORDEM de entrada e saida de cada um, para melhor controle de uso do tempo de cada um. Por que atualmente os nomes ficam todos misturados e isto provoca conflitos na vez de utilizar o computador entre usuarios.', '', 'Quiteria Batist', 'Pontal do Parana', '', 'Carlos Eduardo Bento', 'NR PARANAGUA'),
